function Celda({ value }) {


    let view = false;
    let valor = " ";
    if (view) {
        valor = value;
    }


    return (
        <div>
            <button className="cell" onClick={btnComenzar}>
                {/* Contenido de la celda */}
                {valor}
            </button>
        </div>
    );
}

export default Celda;
